import React from 'react';
import "../estilos/caja.css"

function Bloque1(props) {
  return (
    <div className='contenedorTexto'>
      <h5
        className='contenedorTitulo'>{props.titulo}
      </h5>
      <p
        className='contenedorParrafo'>{props.texto}
      </p>
    </div>
  );
}

export default Bloque1;
